import React from 'react'

export default class QuestionCollection extends React.Component {
    questionList = () => {
        return this.props.questions.map((question,index) => <Question key={index} quesiton={question}/>)
    }
   render() {
       return (
           <div id="questions_container">
                { this.questionList}
           </div>
       )
   }
}
